    u_xlat10_1.xyz = texture2D(_MainTex, vs_TEXCOORD0.xy).xyz;
    u_xlat16_2.xyz = u_xlat10_1.xyz * _LightColor0.xyz;
    SV_Target0.xyz = vec3(u_xlat16_0) * u_xlat16_2.xyz;
